import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

// Components

import FoodList from "./components/FoodList";
import OrderPage from "./components/OrderPage";
import PaymentPage from "./components/PaymentPage";
import OrderConfirmation from "./components/OrderConfirmation";

// Pages
import Home from "./pages/Home";
import Login from "./pages/Login";
import Signup from "./pages/Signup";
import Listings from "./pages/Listings";
import Reviews from "./pages/Reviews";
import Notifications from "./pages/Notifications";
import Places from "./pages/Places";
import Explore from "./pages/Explore";
import Stays from "./pages/Stays";
import Food from "./pages/food";
import Contacts from "./pages/Contacts";
import Booking from "./pages/Booking";
import FoodOrder from "./pages/FoodOrder";
import Cart from "./pages/Cart";
import Payment from "./pages/Payment";

// CSS

function App() {
  // State for cart functionality
  const [cartItems, setCartItems] = useState([]);

  // Cart functions
  const addToCart = (item) => {
    setCartItems([...cartItems, item]);
  };

  return (
    <Router>
      <Navbar />
      <div className="container mx-auto mt-5 px-4">
        <Routes>
          {/* Main Pages */}
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/signup" element={<Signup />} />
          <Route path="/register" element={<Signup />} />{" "}
          {/* Alias for signup */}
          {/* Exploration & Listings */}
          <Route path="/listings" element={<Listings />} />
          <Route path="/reviews" element={<Reviews />} />
          <Route path="/notifications" element={<Notifications />} />
          <Route path="/places" element={<Places />} />
          <Route path="/explore" element={<Explore />} />
          <Route path="/contacts" element={<Contacts />} />
          <Route path="/contact" element={<Contacts />} />{" "}
          {/* Alias for contacts */}
          {/* Cart & Payment */}
          <Route path="/cart" element={<Cart cartItems={cartItems} />} />
          {/* Stays/Booking System */}
          <Route path="/stays" element={<Stays addToCart={addToCart} />} />
          <Route path="/booking/:stayId" element={<Booking />} />
          <Route
            path="/booking"
            element={
              <>
                <h1>Booking System</h1>
                <BookingForm />
                <BookingList />
              </>
            }
          />
          {/* Food Ordering System */}
          <Route path="/foods" element={<FoodList />} />
          <Route path="/food" element={<Food addToCart={addToCart} />} />
          <Route path="/food-order/:foodId" element={<FoodOrder />} />
          <Route path="/order" element={<OrderPage />} />
          <Route path="/order/:foodId" element={<OrderPage />} />
          <Route path="/order-confirmation" element={<OrderConfirmation />} />
          {/* Payment Routes */}
          <Route path="/payment" element={<Payment />} />
          <Route path="/payment/:orderId" element={<PaymentPage />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
